// src/components/models/ModelViewModal.jsx
import React from "react";
import { useDeletePortfolioImageMutation } from "../../redux/api/modelApi";
import toast from "react-hot-toast";

const ModelViewModal = ({ model, onClose }) => {
  const [deleteImage] = useDeletePortfolioImageMutation();

  const handleDelete = async (public_id) => {
    if (!window.confirm("Delete this image?")) return;
    try {
      await deleteImage({ id: model._id, public_id }).unwrap();
      toast.success("Image deleted");
      // caller (list) will refetch if needed; close modal to reflect fresh data or you can re-fetch single model
      onClose();
    } catch (err) {
      toast.error("Delete failed");
    }
  };

  return (
    <div className="modal show d-block" tabIndex="-1">
      <div className="modal-dialog modal-lg">
        <div className="modal-content">
          <div className="modal-header">
            <h5 className="modal-title">
              {model.firstName} {model.lastName}
            </h5>
            <button className="btn-close" onClick={onClose}></button>
          </div>
          <div className="modal-body">
            <div className="d-flex gap-3 mb-3">
              <div style={{ width: 140, height: 160 }}>
                {model.profileImage?.url ? (
                  <img
                    src={model.profileImage.url}
                    alt="pf"
                    style={{
                      width: "100%",
                      height: "100%",
                      objectFit: "cover",
                      borderRadius: 6,
                    }}
                  />
                ) : (
                  <div className="border p-3">No image</div>
                )}
              </div>
              <div>
                <p>
                  <b>Stage name:</b> {model.stageName || "-"}
                </p>
                <p>
                  <b>Gender:</b> {model.gender}
                </p>
                <p>
                  <b>City:</b> {model.city || "-"}
                </p>
                <p>
                  <b>Experience:</b> {model.experienceLevel || "-"}
                </p>
                <p>
                  <b>Skills:</b> {(model.skills || []).join(", ") || "-"}
                </p>
              </div>
            </div>

            <h6>Portfolio</h6>
            <div className="d-flex flex-wrap gap-2">
              {(model.portfolio || []).map((p) => (
                <div
                  key={p.public_id || p.url}
                  style={{ position: "relative", width: 120, height: 120 }}
                >
                  <img
                    src={p.url}
                    alt=""
                    style={{
                      width: "100%",
                      height: "100%",
                      objectFit: "cover",
                      borderRadius: 6,
                    }}
                  />
                  <button
                    className="btn btn-sm btn-danger"
                    style={{ position: "absolute", top: 6, right: 6 }}
                    onClick={() => handleDelete(p.public_id)}
                  >
                    âœ•
                  </button>
                </div>
              ))}
              {(!model.portfolio || model.portfolio.length === 0) && (
                <div>No portfolio uploaded</div>
              )}
            </div>
          </div>
          <div className="modal-footer">
            <button className="btn btn-secondary" onClick={onClose}>
              Close
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ModelViewModal;
